window.bookSummaryJSON = "<p>Martin and Iron Riot have made their mark on the Dungeons of Strata, slaying the first of the nightmarish Archdukes faster than anyone could have hoped. Yet the dungeon has left its marks on them, too.</p> <p>Scarred with wounds that will not heal and changed in ways that he cannot comprehend, Martin must contend with the mysterious true nature of the game and the lengths that the Masters who made this world are willing to go to keep their secrets.</p> <p>The Masters have complete control over everything in Strata. They now hunt Martin outside the game, using every means at their disposal to put a stop to his progress.</p> <p>But they have forgotten the age-old adage: never corner a rat.</p>"; 
